import React, { Component } from "react";
import "./Signup.css";

export default class UserInfo extends Component {
  constructor(props) {
    super(props);
  }
  state = {
    email : '',
    password : ''
  }
  render() {
    return (
      <form>
        <input
          type="text"
          className="email"
          placeholder="Enter Email"
        ></input>
        <input
          type="password"
          className="password"
          placeholder="Enter Password"
        ></input>
        <button type="button">Sign Up</button>
      </form>
    );
  }
}
